import React, { useState, useEffect } from "react";
import axios from "axios";
import { Container, Table, TableHead, TableRow, TableCell, TableBody, Button, TextField, Dialog, DialogActions, DialogContent, DialogTitle } from "@mui/material";

const App = () => {
  const [users, setUsers] = useState([]);
  const [open, setOpen] = useState(false);
  const [currentUser, setCurrentUser] = useState(null);
  const [formData, setFormData] = useState({ name: "", email: "" });

  useEffect(() => {
    fetchUsers();
  }, []);

  // Fetch all users
  const fetchUsers = async () => {
    try {
      const response = await axios.get("http://localhost:3001/users");
      setUsers(response.data.users);
    } catch (error) {
      console.error("Error fetching users:", error);
    }
  };

  // Handle delete
  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:3001/users/${id}`);
      setUsers(users.filter((user) => user.id !== id));
    } catch (error) {
      console.error("Error deleting user:", error);
    }
  };

  // Handle open dialog for edit or add
  const handleOpen = (user = null) => {
    setCurrentUser(user);
    setFormData(user || { name: "", email: "" });
    setOpen(true);
  };

  // Handle close dialog
  const handleClose = () => {
    setOpen(false);
  };

  // Handle form submit
  const handleSubmit = async () => {
    console.log("submit");
    try {
      if (currentUser) {
        // Update user
        await axios.patch(`http://localhost:3001/users/${currentUser.id}`, formData);
        setUsers(users.map((user) => (user.id === currentUser.id ? { ...user, ...formData } : user)));
      } else {
        // Add user
        const response = await axios.post("http://localhost:3001/users", formData);
        setUsers([...users, response.data]);
      }
      handleClose();
    } catch (error) {
      console.error("Error saving user:", error);
    }
  };

  return (
    <Container>
      <h1>User Management</h1>
      <Button variant="contained" color="primary" onClick={() => handleOpen()}>
        Add User
      </Button>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Name</TableCell>
            <TableCell>Email</TableCell>
            <TableCell>Actions</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {users.map((user) => (
            <TableRow key={user.id}>
              <TableCell>{user.name}</TableCell>
              <TableCell>{user.email}</TableCell>
              <TableCell>
                <Button variant="contained" color="secondary" onClick={() => handleDelete(user.id)}>
                  Delete
                </Button>
                <Button variant="contained" color="primary" onClick={() => handleOpen(user)}>
                  Edit
                </Button>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>

      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>{currentUser ? "Edit User" : "Add User"}</DialogTitle>
        <DialogContent>
          <TextField
            label="Name"
            fullWidth
            margin="normal"
            value={formData.name}
            onChange={(e) => setFormData({ ...formData, name: e.target.value })}
          />
          <TextField
            label="Email"
            fullWidth
            margin="normal"
            value={formData.email}
            onChange={(e) => setFormData({ ...formData, email: e.target.value })}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="secondary">
            Cancel
          </Button>
          <Button onClick={handleSubmit} color="primary">
            Save
          </Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
};

export default App;
